import React from 'react';
import './css/Signup.css';

class Signup extends React.Component {
    redirect = (e) => {
    }

    render() {
        return (
            <div id="signup-container" className="d-flex justify-content-center align-items-center">
            <button className="btn-lg btn-primary mb-4" onClick={this.redirect}>Log In</button>
            <button className="btn-lg btn-primary" onClick={this.redirect}>Sign Up</button>
            </div>
        );
    }
}

export default Signup;
